import React from "react";

function Home() {
  return (
    <div>
      <h1>DiveIn</h1>
      <h2>Start Learning Right Away</h2>
      <p>
        We aim to help you develop knowledge. Just choose your topic of
        interest, and start reading. Each piece of content is from one of the
        top bloggers in the respective fields. So, dive right in! :)
      </p>
    </div>
  );
}
export default Home;
